[[Dorgesh-Kaan]] rich '''Chests''' require 78 [[Thieving]] and a [[lockpick]] to loot. Doing so yields loot and 650 Thieving [[experience]]. Chest loot respawns every 300 seconds.

[[Chest (Dorgesh-Kaan Average)|Dorgesh-Kaan average chest]]s also exist in the houses around the city, they have a lower Thieving requirement but do not drop [[gem]]s.

